/*Table structure for table `company_capital` */

DROP TABLE IF EXISTS `company_capital`;

CREATE TABLE `company_capital` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '账户id',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `name` varchar(100) NOT NULL COMMENT '账户名',
  `type` enum('1','2') NOT NULL DEFAULT '1' COMMENT '账户类型(1现金;2赠送;)',
  `is_project` enum('1','0') NOT NULL DEFAULT '1' COMMENT '能否购买项目',
  `is_product` enum('1','0') NOT NULL DEFAULT '1' COMMENT '能否购买产品',
  `is_voucher` enum('1','0') NOT NULL DEFAULT '1' COMMENT '能否购买卡劵',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '当前状态(启用、停用)',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `note` text COMMENT '账户说明',
  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`),
  KEY `type` (`type`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='资金账户表';

