  `check_time` int(11) DEFAULT NULL COMMENT '审核时间',
  `server_time` int(11) DEFAULT NULL COMMENT '服务截止时间',
  `config` text COMMENT '公司配置信息(序列化数据)',
  `auto_cu_status` enum('0','1') NOT NULL DEFAULT '0' COMMENT '是否自动更新客户状态(0/1)',
  `pca_province` varchar(50) DEFAULT NULL COMMENT '省',
  `pca_city` varchar(50) DEFAULT NULL COMMENT '市',
  `address` varchar(400) DEFAULT NULL COMMENT '详细地址',
  `phone` varchar(20) NOT NULL COMMENT '老板电话',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `boss_name` varchar(100) NOT NULL COMMENT '老板姓名',
  `store_num` int(5) NOT NULL DEFAULT '1' COMMENT '门店数量',
  `max_store_num` int(5) NOT NULL DEFAULT '3' COMMENT '可用门店数',
  `wx_server_sn` varchar(200) DEFAULT NULL COMMENT '微信服务号',
  `wx_server_pass` varchar(200) DEFAULT NULL COMMENT '微信服务号密码',
  `step` tinyint(4) NOT NULL DEFAULT '1' COMMENT '注册到第几步,0为已经注册完成,再无法进入注册',
