  `email` varchar(100) DEFAULT NULL COMMENT '联系邮箱(作废)',
  `check_code` varchar(100) DEFAULT NULL COMMENT '注册校验码（废弃）',
  `qq` varchar(100) DEFAULT NULL COMMENT '联系人QQ(作废)',
  `contact_name` varchar(100) DEFAULT NULL COMMENT '联系人（废弃）',
  `wx` varchar(100) DEFAULT NULL COMMENT '联系人微信号(作废)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='公司信息';

