/*Table structure for table `company_sn` */

DROP TABLE IF EXISTS `company_sn`;

CREATE TABLE `company_sn` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `comp_id` int(10) unsigned NOT NULL COMMENT '公司ID',
  `sn_type` varchar(50) NOT NULL COMMENT '订单类型',
  `sn_count` smallint(5) unsigned zerofill NOT NULL DEFAULT '00001' COMMENT '订单计数器',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`),
  KEY `sn_before` (`sn_type`)
