/*Table structure for table `config_invo_cycle` */

DROP TABLE IF EXISTS `config_invo_cycle`;

CREATE TABLE `config_invo_cycle` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '盘库周期类型（1、每周 2、每月 ...）',
