/*Table structure for table `config_membership` */

DROP TABLE IF EXISTS `config_membership`;

CREATE TABLE `config_membership` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `level_name` varchar(255) NOT NULL COMMENT '会员卡名称',
  `level` smallint(5) NOT NULL COMMENT '级别',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态（1、正常 -1、删除）',
  `is_member` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否为正式会员(1正式会员,0非正式会员)',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `note` text COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `level_name` (`level_name`),
  KEY `is_member` (`is_member`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='会员等级管理表';

