/*Table structure for table `config_voucher` */

DROP TABLE IF EXISTS `config_voucher`;

CREATE TABLE `config_voucher` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(10) unsigned NOT NULL COMMENT '公司',
  `name` varchar(100) NOT NULL COMMENT '卡券名称',
  `stime` int(10) unsigned NOT NULL COMMENT '有效时间-开始时间',
  `etime` int(10) unsigned NOT NULL COMMENT '有效时间-结束时间',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '售价(0为赠送)',
  `num` int(11) NOT NULL COMMENT '卡券数量(-1为无限)',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '现金',
  `give_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '赠送现金',
  `sold_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '已发售数量',
  `over_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '已用完数量',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0停用,1启用)',
  `user_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '使用类型',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `note` text COMMENT '备注',
  `scope` tinyint(2) NOT NULL DEFAULT '1' COMMENT '0不限/1正式会员/2非正式会议',
  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`)
) ENGINE=MyISAM AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 COMMENT='卡券';

