/*Table structure for table `customer_analysis` */

DROP TABLE IF EXISTS `customer_analysis`;

CREATE TABLE `customer_analysis` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `dept_id` int(11) NOT NULL COMMENT '门店id',
  `cu_id` int(11) NOT NULL COMMENT '客户id',
  `year` int(11) NOT NULL COMMENT '年',
  `month` int(11) NOT NULL COMMENT '月',
  `cash` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金',
  `card` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卡扣',
  `use_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实耗(当时购买应付单价*次数累计)',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `comp_id_dept_id_cu_id` (`comp_id`,`dept_id`,`cu_id`),
  KEY `year_month` (`year`,`month`)
