/*Table structure for table `customer_capital` */

DROP TABLE IF EXISTS `customer_capital`;

CREATE TABLE `customer_capital` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cu_id` int(11) unsigned NOT NULL COMMENT '客户',
  `capital_id` int(11) unsigned NOT NULL COMMENT '资金账户',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前余额',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `note` text COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `cu_id_capital_id` (`cu_id`,`capital_id`),
  KEY `cu_id` (`cu_id`),
  KEY `capital_id` (`capital_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='客户账户(现金/赠送)';

