/*Table structure for table `customer_capital_log` */

DROP TABLE IF EXISTS `customer_capital_log`;

CREATE TABLE `customer_capital_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '流水id',
  `cu_capital_id` int(11) NOT NULL COMMENT '客户的账户id',
  `before_money` decimal(10,2) NOT NULL COMMENT '操作前金额',
  `money` decimal(10,2) unsigned NOT NULL COMMENT '操作金额',
  `after_money` decimal(10,2) NOT NULL COMMENT '操作后金额',
  `rel_id` int(11) unsigned NOT NULL COMMENT '单据id',
  `rel_type` tinyint(2) NOT NULL COMMENT '单据类型(1订单order_sale，2退款单order_refund,3卡卷兑换order_voucher)',
  `rel_ext` int(11) DEFAULT '0' COMMENT '单据保留字段',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `pos_dir` enum('in','out') NOT NULL COMMENT '进、出',
  PRIMARY KEY (`id`),
  KEY `create_time` (`create_time`),
  KEY `account_id` (`cu_capital_id`),
  KEY `rel_id_rel_type` (`rel_id`,`rel_type`),
  CONSTRAINT `customer_capital_log_del` FOREIGN KEY (`cu_capital_id`) REFERENCES `customer_capital` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8 COMMENT='资金日志';

