/*Table structure for table `customer_info` */

DROP TABLE IF EXISTS `customer_info`;

CREATE TABLE `customer_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cardid` varchar(50) DEFAULT NULL COMMENT '卡号',
  `name` varchar(200) NOT NULL COMMENT '姓名',
  `arrears` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '欠款',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '积分',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机',
  `tel` varchar(20) DEFAULT NULL COMMENT '固话电话(手机固话必填一个)',
  `back_phone` varchar(20) DEFAULT NULL COMMENT '备用电话或手机',
  `sex` enum('男','女') NOT NULL DEFAULT '男' COMMENT '性别',
  `birthday` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '阳历生日',
  `zh_birthday` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '农历生日',
  `zh_zodiac` enum('鼠','牛','虎','兔','龙','蛇','马','羊','猴','鸡','狗','猪') DEFAULT NULL COMMENT '属相',
  `zodiak` enum('水瓶座','双鱼座','白羊座','金牛座','双子座','巨蟹座','狮子座','处女座','天秤座','天蝎座','射手座','摩羯座') DEFAULT NULL COMMENT '星座',
  `profession_type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '职业类型(1全职,2兼职,3退休,4家庭妇女5.自由职业6.企业主)',
  `marriage` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '婚姻状况(1未婚,2已婚,3离异,4丧偶)',
  `idcard` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `weixin` varchar(50) DEFAULT NULL COMMENT '微信号',
  `qq` int(20) unsigned DEFAULT '0' COMMENT 'QQ号',
  `address` varchar(500) DEFAULT NULL COMMENT '地址',
  `company_id` int(11) unsigned NOT NULL COMMENT '公司',
  `store_id` int(11) unsigned NOT NULL COMMENT '归属门店',
  `come_type` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '客户来源(1.自上门.2.外联3.嘉宾4.拓客5.广告6.其他7.系统会员)',
  `cu_type` enum('未分类','A','B','C','D','E') NOT NULL DEFAULT '未分类' COMMENT '客户类型(ABCD...)',
  `counselor_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '专属顾问',
  `operator_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '专属美疗师',
  `ext_id` int(11) unsigned NOT NULL DEFAULT '0',
  `membership_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员卡级',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '客户状态（活跃1、久档2、死档3、无效-1、未知0）',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '建档时间',
  `last_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最后到店时间',
  `enrollment_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '入会时间',
  `note` text COMMENT '备注',
  `cart_init` tinyint(4) NOT NULL DEFAULT '0' COMMENT '客户期初状态(0可建期初 1已建期初订单，但未审核 2期初订单已通过审核)',
  PRIMARY KEY (`id`),
  KEY `cu_type` (`cu_type`),
  KEY `counselor_id` (`counselor_id`),
  KEY `operator_id` (`operator_id`),
  KEY `state` (`status`),
  KEY `create_time` (`create_time`),
  KEY `ext_id` (`ext_id`),
  KEY `company_id and dept_id` (`company_id`,`store_id`),
  KEY `membership_id` (`membership_id`),
  FULLTEXT KEY `name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=80 DEFAULT CHARSET=utf8 COMMENT='客户';

