/*Table structure for table `customer_prod_receive` */

DROP TABLE IF EXISTS `customer_prod_receive`;

CREATE TABLE `customer_prod_receive` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sn` varchar(255) NOT NULL COMMENT '客户产品领取单号',
  `dept_id` int(11) NOT NULL COMMENT '门店id',
  `cu_id` int(11) NOT NULL COMMENT '客户id',
  `create_user` int(11) NOT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `re_status` enum('0','1') NOT NULL DEFAULT '0' COMMENT '领取状态（0、未领取 1、已领取）',
  `receive_time` int(11) DEFAULT '0' COMMENT '领取时间',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态',
  `remark` text COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `dept_id` (`dept_id`),
  KEY `customer_id` (`cu_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='客户产品领取表';

