/*Table structure for table `customer_satisfice` */

DROP TABLE IF EXISTS `customer_satisfice`;

CREATE TABLE `customer_satisfice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `md_id` int(11) NOT NULL COMMENT '门店id',
  `practice_id` int(11) NOT NULL COMMENT '实操单id',
  `cu_id` int(11) NOT NULL COMMENT '用户id',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `note` text COMMENT '补充说明',
  PRIMARY KEY (`id`),
  KEY `practice_id` (`practice_id`),
  KEY `comp_id` (`comp_id`),
  KEY `md_id` (`md_id`),
  KEY `cu_id` (`cu_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='调查表';

