  `pro_id` int(11) NOT NULL COMMENT '主表customer_satisfice.id',
  `config_id` int(11) NOT NULL COMMENT '配置表config_stisfice.id',
  `score` tinyint(4) NOT NULL COMMENT '分数',
  `note` text COMMENT '说明',
  PRIMARY KEY (`id`),
  KEY `pro_id` (`pro_id`),
  KEY `config_id` (`config_id`),
  CONSTRAINT `FK__customer_satisfice` FOREIGN KEY (`pro_id`) REFERENCES `customer_satisfice` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='客户调查表详情';

