/*Table structure for table `employ_position` */

DROP TABLE IF EXISTS `employ_position`;

CREATE TABLE `employ_position` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增唯一主键',
  `comp_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '公司id',
  `position_name` varchar(100) NOT NULL COMMENT '职务名称',
  `type` tinyint(4) NOT NULL DEFAULT '2' COMMENT '1总店/2门店/3平台',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态（1.正常, 0.停用, -1.删除）',
  `dept_id` int(11) NOT NULL COMMENT '部门id(无效字段)',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `dept_id` (`dept_id`),
  KEY `comp_id` (`comp_id`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='职位';

