/*Table structure for table `employ_user` */

DROP TABLE IF EXISTS `employ_user`;

CREATE TABLE `employ_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `netname` varchar(255) NOT NULL COMMENT '姓名',
  `user_name` varchar(255) NOT NULL COMMENT '登录用户名',
  `password` varchar(255) NOT NULL COMMENT '登录密码',
  `position_id` int(11) NOT NULL COMMENT '职位',
  `dept_id` int(11) NOT NULL COMMENT '部门',
  `sex` enum('男','女','未填写') NOT NULL DEFAULT '未填写' COMMENT '性别（1、男 2、女）',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态（1、正常 -1、删除）',
  `login_num` int(11) NOT NULL DEFAULT '0' COMMENT '登录次数',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `note` text COMMENT '备注',
  `identifier` varchar(32) DEFAULT NULL COMMENT '自动登录标识符',
  `token` varchar(32) DEFAULT NULL COMMENT '自动登录令牌',
  `timeout` int(11) DEFAULT NULL COMMENT '自动登录超时时间',
  `last_login_time` int(11) DEFAULT NULL COMMENT '最后登录时间',
  PRIMARY KEY (`id`),
  KEY `current_position` (`position_id`),
  KEY `comp_id` (`comp_id`),
  KEY `dept_id` (`dept_id`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8 COMMENT='公司的员工表';

