/*Table structure for table `invo_dept` */

DROP TABLE IF EXISTS `invo_dept`;

CREATE TABLE `invo_dept` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
