  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`),
  KEY `dept_id` (`dept_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 COMMENT='门店分仓的库存表';

