/*Table structure for table `invo_gain_loss` */

DROP TABLE IF EXISTS `invo_gain_loss`;

CREATE TABLE `invo_gain_loss` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sn` varchar(255) NOT NULL COMMENT '损溢单号',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `dept_id` int(11) NOT NULL COMMENT '门店id',
  `type` enum('-1','1') NOT NULL DEFAULT '-1' COMMENT '损溢类型（-1、报损 1、报溢）',
  `is_regular` enum('1','0') NOT NULL DEFAULT '1' COMMENT '损溢分类（1、日常损溢 0、盘库损溢）',
  `inventory_id` int(11) DEFAULT '0' COMMENT '盘库表id（当盘库损溢时不为空）',
  `create_user` int(11) NOT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态',
  `note` text COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sn` (`sn`),
  KEY `dept_id` (`dept_id`),
  KEY `comp_id` (`comp_id`),
  KEY `inventory_id` (`inventory_id`),
  KEY `type` (`type`),
  KEY `is_regular` (`is_regular`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='商品损溢表';

