CREATE TABLE `invo_gain_loss_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_id` int(11) NOT NULL COMMENT '损溢单id',
  `product_id` int(11) NOT NULL COMMENT '商品id',
