/*Table structure for table `invo_in` */

DROP TABLE IF EXISTS `invo_in`;

CREATE TABLE `invo_in` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sn` varchar(255) NOT NULL COMMENT '入库单号',
  `type` tinyint(2) DEFAULT '1' COMMENT '入库类型（1调拨入库 2分仓退货 4采购入库 5购买退货）',
  `from_id` int(11) DEFAULT '0' COMMENT '入库的来源（type=1时，调拨出库单id）',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `dept_id` int(11) NOT NULL COMMENT '门店id',
  `create_user` int(11) NOT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `in_status` enum('0','1') NOT NULL DEFAULT '0' COMMENT '入库状态（0、未入库 1、已入库）',
  `in_time` int(11) DEFAULT '0' COMMENT '入库时间',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态',
  `note` text COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `sn` (`sn`),
  KEY `comp_id_dept_id` (`comp_id`,`dept_id`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COMMENT='商品入库表';

