  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `inventory_id` int(11) NOT NULL COMMENT '盘库表id',
  `product_id` int(11) NOT NULL COMMENT '商品id',
  `dept_pro_id` int(11) NOT NULL COMMENT '分仓商品id',
  `last_num` mediumint(5) NOT NULL COMMENT '上期库存',
  `last_ext_num` mediumint(5) NOT NULL DEFAULT '0' COMMENT '上期额外数量（还能使用的次数）',
  `curr_num` mediumint(5) NOT NULL COMMENT '本期实时库存',
  `curr_storage_num` mediumint(5) NOT NULL COMMENT '本期实时寄存',
  `curr_ext_num` mediumint(5) NOT NULL DEFAULT '0' COMMENT '本期实时额外数量',
