  `is_auto` enum('0','1') NOT NULL DEFAULT '0' COMMENT '盘库类型（0、手动盘库 1、自动盘库）',
  PRIMARY KEY (`id`),
  KEY `inventory_id` (`inventory_id`),
  KEY `dept_pro_id` (`dept_pro_id`),
  KEY `product_id` (`product_id`),
  CONSTRAINT `invo_inventory_detail_ibfk_1` FOREIGN KEY (`inventory_id`) REFERENCES `invo_inventory` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='商品盘库详情表';

