/*Table structure for table `invo_out` */

DROP TABLE IF EXISTS `invo_out`;

CREATE TABLE `invo_out` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sn` varchar(255) NOT NULL COMMENT '出库单号',
  `comp_id` int(11) NOT NULL,
  `dept_id` int(11) NOT NULL COMMENT '门店id',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '出库类型（1、调拨出库 2、领用出库 3、领取出库  4、采购退货）',
