/*Table structure for table `order_sale` */

DROP TABLE IF EXISTS `order_sale`;

CREATE TABLE `order_sale` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `sn` varchar(100) NOT NULL COMMENT '单号',
  `md_id` int(11) NOT NULL COMMENT '门店id',
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `cu_id` int(11) NOT NULL COMMENT '客户Id',
  `made_id` int(11) NOT NULL COMMENT '制单人id',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `pay_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '应付金额=cash相关+arrears',
  `rebate` decimal(5,2) NOT NULL DEFAULT '100.00' COMMENT '折扣率=(应付金额)/price（85.00 八五折）',
  `cash_card` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金账户卡扣',
  `cash` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现钞',
  `cash_pos` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'POS现金',
  `cash_tra` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '转账现金',
  `cash_other` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '其他付款现金',
  `pos_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'POS机类型',
  `tra_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '转账类型',
  `other_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '其他付款类型',
  `score` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分',
  `arrears` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '购买时欠款',
  `current_arrears` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前欠款',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '订单类型(0还款、1购买、2充值、3项目兑换、4积分兑换)',
  `pay_time` int(11) NOT NULL COMMENT '付款时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建、更新时间',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单状态(0草稿,1正常,-1废除)',
  `pay_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '付款状态(0未付款,1已付款)',
  `check_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '账审状态(0未审核)',
  `note` text COMMENT '备注',
  `rh_id` int(11) NOT NULL DEFAULT '0' COMMENT '入会等级id(购买、充值有效)',
  `is_init` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否期初订单(0正常订单 1期初订单)',
  PRIMARY KEY (`id`),
  KEY `cu_id` (`cu_id`),
  KEY `md_id` (`md_id`),
  KEY `type` (`type`),
  KEY `comp_id` (`comp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=utf8 COMMENT='业务单据';

