/*Table structure for table `order_sale_detail` */

DROP TABLE IF EXISTS `order_sale_detail`;

CREATE TABLE `order_sale_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '详单id',
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `pro_id` int(11) NOT NULL COMMENT '商品id',
  `pro_type` tinyint(2) NOT NULL COMMENT '商品类型(1项目、2产品、3卡券、4充值)',
  `md_id` int(11) NOT NULL COMMENT '门店id(必要冗余)',
  `cu_id` int(11) NOT NULL COMMENT '客户id(必要冗余)',
  `num` int(5) NOT NULL DEFAULT '1' COMMENT '购买数量',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价(单价*数量)',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '应付金额= 原价*rebate-card_gift',
  `promotion_id` int(11) NOT NULL DEFAULT '0' COMMENT '促销活动',
  `cash` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现钞+pos',
  `score` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分',
  `arrears` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实时欠款',
  `card_cash` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金账户卡扣合计',
  `card_gift` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赠送账户抵扣合计',
  `rebate` decimal(5,2) NOT NULL DEFAULT '100.00' COMMENT '折扣率(仅指面折率)',
  `buy_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '购买类型(1购买、2赠送、3卡券兑换)',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `var_price` decimal(10,2) DEFAULT '0.00' COMMENT '最新实付金额（现金+卡扣）',
  PRIMARY KEY (`id`),
  KEY `del` (`order_id`),
  KEY `md_id` (`md_id`),
  KEY `cu_id` (`cu_id`)
) ENGINE=InnoDB AUTO_INCREMENT=297 DEFAULT CHARSET=utf8 COMMENT='订单详单（单个商品属性）';

