/*Table structure for table `order_sale_detail_money` */

DROP TABLE IF EXISTS `order_sale_detail_money`;

CREATE TABLE `order_sale_detail_money` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '账户支出id',
  `detail_id` int(11) NOT NULL COMMENT '详单id',
  `capital_id` int(11) NOT NULL COMMENT '交易账户id',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '交易金额',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `del_d` (`detail_id`),
  CONSTRAINT `del_d` FOREIGN KEY (`detail_id`) REFERENCES `order_sale_detail` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='detail中单个商品账户付款组成';

