/*Table structure for table `order_sale_money` */

DROP TABLE IF EXISTS `order_sale_money`;

CREATE TABLE `order_sale_money` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `order_id` int(11) NOT NULL COMMENT '订单id',
  `capital_id` int(11) NOT NULL DEFAULT '0' COMMENT '资金账户id',
  `type` enum('1','2') NOT NULL DEFAULT '1' COMMENT '类型(1.账户2.积分(取整))',
  `cash` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现金或者积分(积分取整)',
  PRIMARY KEY (`id`),
  KEY `type` (`type`),
  KEY `order_id` (`order_id`),
  CONSTRAINT `del_gift_money` FOREIGN KEY (`order_id`) REFERENCES `order_sale` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='订单赠送的金钱/积分';

