/*Table structure for table `order_transfer` */

DROP TABLE IF EXISTS `order_transfer`;

CREATE TABLE `order_transfer` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `sn` varchar(100) NOT NULL COMMENT '单号',
  `refund_id` int(11) NOT NULL COMMENT '退款单',
  `sale_id` int(11) NOT NULL COMMENT '购买单据',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '订单类型(退款退项目)',
  `pay_time` int(10) NOT NULL COMMENT '付款时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单状态',
  PRIMARY KEY (`id`),
  KEY `refund_id` (`refund_id`),
  KEY `sale_id` (`sale_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='卡卡转账';

/*Data for the table `order_transfer` */

/*Table structure for table `order_voucher` */

DROP TABLE IF EXISTS `order_voucher`;

CREATE TABLE `order_voucher` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `sn` varchar(100) NOT NULL COMMENT '单号',
  `md_id` int(11) unsigned NOT NULL COMMENT '门店id',
  `comp_id` int(11) unsigned NOT NULL COMMENT '公司id',
  `cu_id` int(11) unsigned NOT NULL COMMENT '客户Id',
  `made_id` int(11) unsigned NOT NULL COMMENT '制单人',
  `vo_id` int(11) unsigned NOT NULL COMMENT '卡卷id(customer_voucher.id)',
  `capital_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '现金账户id',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '现金金额',
  `gift_capital_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '赠送账户id',
  `gift_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '赠送金额',
  `pay_time` int(11) NOT NULL DEFAULT '0' COMMENT '兑换确认时间',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '兑换状态(0草稿,1正常,-1废除)',
  `note` text COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `cu_id` (`cu_id`),
  KEY `md_id` (`md_id`),
  KEY `vo_id` (`vo_id`),
  KEY `made_id` (`made_id`),
  KEY `comp_id` (`comp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COMMENT='卡券兑换';

