/*Table structure for table `project_formula` */

DROP TABLE IF EXISTS `project_formula`;

CREATE TABLE `project_formula` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '自增唯一id',
  `comp_id` int(20) NOT NULL DEFAULT '0' COMMENT '公司id',
  `project_id` int(20) NOT NULL COMMENT '项目',
  `formula_name` varchar(200) NOT NULL COMMENT '项目配方名称',
  `is_default` enum('true','false') NOT NULL DEFAULT 'true' COMMENT '是否默认配方(每个项目只允许一个默认)',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `note` varchar(1000) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `del_c` (`project_id`),
  KEY `comp_id` (`comp_id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='项目配方表';

