/*Table structure for table `project_info` */

DROP TABLE IF EXISTS `project_info`;

CREATE TABLE `project_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `comp_id` int(11) NOT NULL COMMENT '公司id',
  `supp_id` int(11) NOT NULL DEFAULT '0' COMMENT '供应商ID',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `cate` int(11) NOT NULL COMMENT '分类',
  `code` varchar(100) DEFAULT NULL COMMENT '编码',
  `num` smallint(5) NOT NULL DEFAULT '1' COMMENT '项目疗次',
  `price` decimal(10,2) NOT NULL COMMENT '疗次价格',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态(-1删除,0未开账,1正常)',
  `pra_type` enum('1','2','3') NOT NULL DEFAULT '1' COMMENT '美容师实操业绩核算方式(1原价,2.按实际购买金额,3按固定金额)',
  `pra_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '美容师业绩固定实操业绩',
  `pra_type_z` enum('1','2','3') NOT NULL DEFAULT '3' COMMENT '赠送时美容师实操业绩核算方式(1原价,2.按实际购买金额,3按固定金额)',
  `pra_money_z` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '赠送时美容师业绩固定实操业绩',
  `note` text COMMENT '备注',
  `last_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`),
  KEY `cate` (`cate`)
