/*Table structure for table `re_book` */

DROP TABLE IF EXISTS `re_book`;

CREATE TABLE `re_book` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `ymd` int(10) NOT NULL COMMENT '年月日',
  `cu_id` int(20) NOT NULL COMMENT '客户id',
  `company_id` int(20) NOT NULL COMMENT '公司id',
  `dept_id` int(20) NOT NULL COMMENT '门店id',
  `room_id` int(20) NOT NULL COMMENT '房间id',
  `bed_id` int(20) NOT NULL COMMENT '床位id',
  `operator_ids` varchar(50) NOT NULL COMMENT '美疗师',
  `times` varchar(255) NOT NULL COMMENT '时间段(9-24每半小时一段)',
  `starttime` int(11) NOT NULL COMMENT '起始时间',
  `endtime` int(11) NOT NULL COMMENT '结束时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(0取消1预约占用2实际占用3完成释放)',
  `create_time` varchar(255) NOT NULL COMMENT '创建时间',
  `update_time` varchar(255) NOT NULL COMMENT '更新时间',
  `projects` varchar(255) DEFAULT NULL COMMENT '预约的项目',
  PRIMARY KEY (`id`),
  KEY `ymd` (`ymd`),
  KEY `operator_ids` (`operator_ids`),
  KEY `cu_id` (`cu_id`),
  KEY `dept_id` (`dept_id`),
  KEY `room_id` (`room_id`),
  KEY `bed_id` (`bed_id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='邀约本(预约本)';

