/*Table structure for table `sale_notice` */

DROP TABLE IF EXISTS `sale_notice`;

CREATE TABLE `sale_notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '活动id',
  `title` varchar(50) NOT NULL COMMENT '活动名称',
  `note` text COMMENT '活动方案',
  `start_time` int(10) unsigned NOT NULL COMMENT '活动开始时间',
  `end_time` int(10) unsigned NOT NULL DEFAULT '4294967295' COMMENT '活动结束时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '活动状态（-1，删除；0，停用；1，正常）',
  `comp_id` int(11) NOT NULL COMMENT '所属公司id',
  PRIMARY KEY (`id`),
  KEY `comp_id` (`comp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='活动管理';

