/*Table structure for table `sms_message` */

DROP TABLE IF EXISTS `sms_message`;

CREATE TABLE `sms_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增唯一id',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '发信人',
  `to_uid` int(11) NOT NULL DEFAULT '0' COMMENT '当前收信人',
  `to_uids` varchar(200) NOT NULL DEFAULT '0' COMMENT '多收件人',
  `title` varchar(50) DEFAULT NULL COMMENT '消息标题',
  `content` text COMMENT '消息内容',
  `url` varchar(200) DEFAULT NULL COMMENT '跳转',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态(-1删除、0草稿/已读、1正常)',
  `type` enum('inbox','outbox') NOT NULL DEFAULT 'outbox' COMMENT 'in收件箱、out发件箱',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `read_time` int(11) DEFAULT NULL COMMENT '阅读时间(In有效)',
  `note` varchar(1000) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `touid` (`to_uid`)
) ENGINE=InnoDB AUTO_INCREMENT=89 DEFAULT CHARSET=utf8 COMMENT='站内消息中心（非公告）';

