/*Table structure for table `wx_book` */

DROP TABLE IF EXISTS `wx_book`;

CREATE TABLE `wx_book` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cu_id` int(11) NOT NULL COMMENT '客户ID',
  `com_id` int(11) NOT NULL COMMENT '公司ID',
  `dept_id` int(11) NOT NULL COMMENT '门店ID',
  `book_date` date NOT NULL COMMENT '预约日期',
  `book_times` varchar(50) NOT NULL COMMENT '预约时段',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(1未批准，2已批准)',
  `act_time` int(11) NOT NULL DEFAULT '0' COMMENT '批准时间',
  `num` tinyint(4) NOT NULL DEFAULT '1' COMMENT '到店嘉宾人数',
  `re_projects` varchar(255) NOT NULL DEFAULT '' COMMENT '服务项目',
  `linkman` varchar(50) NOT NULL DEFAULT '' COMMENT '联系人',
  `tel` varchar(50) NOT NULL DEFAULT '' COMMENT '联系电话',
  `note` text COMMENT '其他要求',
  PRIMARY KEY (`id`),
  KEY `cu_id` (`cu_id`),
  KEY `com_id` (`com_id`),
  KEY `dept_id` (`dept_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='微信在线到店预约';

