/* Trigger structure for table `order_sale` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `order_sale_after_update` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `order_sale_after_update` AFTER UPDATE ON `order_sale` FOR EACH ROW BEGIN
	DECLARE  a int(11) DEFAULT (SELECT id FROM `customer_analysis` WHERE `comp_id`=NEW.comp_id AND `dept_id`=NEW.md_id AND `cu_id`=NEW.cu_id AND `year`=year(curdate()) AND `month`=month(curdate()));
	DECLARE card_sum  DECIMAL(10,2) DEFAULT (SELECT SUM(card_cash) FROM `order_sale_detail` WHERE order_id=NEW.id);
IF NEW.pay_status=1 THEN /*付款时*/
	
	IF a>0 THEN
		UPDATE `customer_analysis` SET cash=cash+NEW.cash+NEW.cash_pos+NEW.cash_tra+NEW.cash_other ,card=IFNULL(card_sum,0)  WHERE `id` = a;
	ELSE
		INSERT INTO `customer_analysis` (`comp_id`, `dept_id`, `cu_id`, `year`, `month`, `cash`, `card`, `use_money`) VALUES (NEW.comp_id, NEW.md_id,NEW.cu_id, year(curdate()), month(curdate()), NEW.cash+NEW.cash_pos+NEW.cash_tra+NEW.cash_other, IFNULL(card_sum,0), 0);
	END IF;
END IF;
END */$$


DELIMITER ;

/* Trigger structure for table `practice_order` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `practice_order_after_update` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `practice_order_after_update` AFTER UPDATE ON `practice_order` FOR EACH ROW BEGIN
	DECLARE  a int(11)
              DEFAULT (
                    SELECT id 
                    FROM `customer_analysis` 
                    WHERE comp_id=NEW.comp_id AND dept_id=NEW.md_id AND cu_id=NEW.cu_id AND `year`=year(curdate()) AND `month`=month(curdate())
              );
	IF NEW.status=1 THEN /*卡扣时*/
	
	IF a>0 THEN
		UPDATE `customer_analysis` SET use_money=use_money+(SELECT sum(osd.pay_price/osd.num*pod.use_num) FROM practice_order_detail as pod LEFT JOIN order_sale_detail osd ON osd.id=pod.detail_id WHERE pod.por_id=NEW.id)  WHERE `id` = a;
	ELSE
		INSERT INTO `customer_analysis` (`comp_id`, `dept_id`, `cu_id`, `year`, `month`, `cash`, `card`, `use_money`) VALUES (NEW.comp_id, NEW.md_id,NEW.cu_id, year(curdate()), month(curdate()), 0, 0,(SELECT sum(osd.pay_price/osd.num*pod.use_num) FROM practice_order_detail as pod LEFT JOIN order_sale_detail osd ON osd.id=pod.detail_id WHERE pod.por_id=NEW.id));
	END IF;
END IF;
END */$$


DELIMITER ;

